import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Home from '../assets/imgs/Navbarlogo.png';
import '../assets/css/NavbarHead.css'

function NavbarHead() {
    return (
        <Navbar collapseOnSelect expand="lg" className='nav'>
            <Container>
                <Navbar.Brand href="#home"><img src={Home} alt='Home' /> </Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="me-auto">

                    </Nav>

                    <Nav>

                        <Nav.Link href="#deets" style={{ marginRight: '20px', color: 'white' }}>About</Nav.Link>
                        <Nav.Link href="#features" style={{ marginRight: '20px', color: 'white' }}>Contact Us</Nav.Link>
                        <Nav.Link href="#pricing" style={{ marginRight: '20px', color: 'white' }}>TimeTable</Nav.Link>
                        <Nav.Link href="#pricing" style={{ marginRight: '20px', color: 'white' }}>Live Location</Nav.Link>
                        <Button style={{ marginRight: '20px', backgroundColor: '#E50000' }}>Sign in</Button>
                        <Button variant="outline-info" style={{ marginRight: '20px' }}>Info</Button>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default NavbarHead;
